import { MainLayout } from '../Layout/MainLayout'

export default function Contacts() {
  return (
      <MainLayout>
        <div className={'flexWrapper'}>
          <div className="container">
            <h1>Contacts</h1>
          </div>
        </div>
      </MainLayout>
  )
}
